function GetDetails(n,t){var i=GetSearchParam(n,t);HttpPost(`/MORLandInventory/List`,"html",i,function(n){$("#divTable").html("");$("#divTable").html(n)})}function GetSearchParam(n,t){return{name:"test",departmentId:parseInt($("#DepartmentId").val()),zoneId:parseInt($("#ZoneId").val()),divisionId:parseInt($("#DivisionId").val()),inventoriedId:parseInt($("#InventoriedInId").val()),classificationOfLandId:parseInt($("#ClassificationOfLandId").val()),plannedUnplannedLand:$("#PlannedUnplannedLand").val(),pageSize:t,pageNumber:n}}function onPaging(n){GetDetails(parseInt(n),parseInt(currentPageSize));currentPageNumber=n}function onChangePageSize(n){GetDetails(parseInt(currentPageNumber),parseInt(n));currentPageSize=n}function GetZoneList(n){HttpGet(`/PropertyRegistration/GetZoneList/?departmentId=${n}`,"json",function(n){for(var i='<option value="0">All<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#ZoneId").val("0").trigger("change");$("#ZoneId").html(i);$("#DivisionId").val("0").trigger("change")})}function GetDivisionList(n){HttpGet(`/PropertyRegistration/GetDivisionList/?zoneId=${n}`,"json",function(n){for(var i='<option value="0">All<\/option>',t=0;t<n.length;t++)i=i+"<option value="+n[t].id+">"+n[t].name+"<\/option>";$("#DivisionId").val("0").trigger("change");$("#DivisionId").html(i)})}var currentPageNumber=1,currentPageSize=10;$(document).ready(function(){GetDetails(currentPageNumber,currentPageSize)});$("#btnSearch").click(function(){GetDetails(currentPageNumber,currentPageSize)});$("#btnReset").click(function(){$("#DepartmentId").val("0").trigger("change");$("#ZoneId").val("0").trigger("change");$("#DivisionId").val("0").trigger("change");$("#InventoriedInId").val("0").trigger("change");$("#ClassificationOfLandId").val("0").trigger("change");$("#PlannedUnplannedLand").val("0").trigger("change");GetDetails(currentPageNumber,currentPageSize)});